import React, { Component } from 'react'
import {Link} from 'react-router-dom'
import '../App.css';


// Navbar class of navigation bar
export default class Navbar extends Component {
   constructor(props) {
       super(props)
   
       this.state = {
            nav:false,
       }
   }
  
   logout = () => {
    
    const token = localStorage.getItem("token");
    localStorage.removeItem("token");
    
  };
   
    render() {
        
        
        return (
            <div className="nav-container">
                <nav className="navbar">
                <Link to="/" ><img className="logo"src={require('../Media/logo-falcon.png')}></img></Link>
                {/*if you want to add a button on the right of navbar <span className="applybtn" ></span> */}
                </nav>    
               
               {!token ? (
         
         <button className="logout" onClick={this.logout}>
         Log out
       </button>) :(
            <button className="logout">
            Log out
          </button>
        )
        
    }
    
        
           
                       
            </div>
        )
    }
}
